import Logo2 from "../../../assets/img2.png";
import { ThemeDiv, ThemeHeader } from "./style";
import { FiMenu } from "react-icons/fi";
import { FiHome } from "react-icons/fi";
import { BiUserCircle } from "react-icons/bi";
import { VscBook } from "react-icons/vsc";
import { MdInsertInvitation } from "react-icons/md";
import { FiMail } from "react-icons/fi";

const HeaderModal = ({ closeModal }) => {
  return (
    <>
      <ThemeHeader w="100%" h="100px" bc="#68DAD8" j="space-between" a="center">
        <img src={Logo2} alt="Logo" />
        <FiMenu onClick={() => closeModal} className="button1" />
      </ThemeHeader>

      <ThemeDiv f="column" g="20px">
        <hr />
        <ThemeDiv a="center" g="20px" >
          <FiHome /> <h2>Home</h2>
        </ThemeDiv>
        <hr />
        <ThemeDiv a="center" g="20px">
          <BiUserCircle /> <h2>Login</h2>
        </ThemeDiv>
        <hr />
        <ThemeDiv a="center" g="20px">
          <VscBook /> <h2>Cadastrar escola</h2>
        </ThemeDiv>
        <hr />
        <ThemeDiv a="center" g="20px">
          <MdInsertInvitation /> <h2>Eventos</h2>
        </ThemeDiv>
        <hr />
        <ThemeDiv a="center" g="20px">
          <FiMail /> <h2>Email para contato</h2>
        </ThemeDiv>
        <hr />
      </ThemeDiv>
    </>
  );
};

export default HeaderModal;
